import React from 'react';
import MailchimpSubscribe from 'react-mailchimp-subscribe';
import VolunteerForm from '../components/VolunteerForm';

export const CustomForm = () => {
	return(
		 <form >
        	<input type="text" name="Name" id="" />
        	<input type="tel" name="Name" id="" />
        	<input type="email" name="Email" id="" />
    		<input type="text" name="Zip" id="" />
    		<button>Submit</button>
        </form>
	);
};

class Volunteer extends React.Component {

	formSubmit = (e) => {
		e.preventDefault();
	}

	renderInput = ({ subscribe, status, message }) => {
		return(
			<div>

					<div id="mc_embed_signup">
						<form action="https://friendsofbellingham.us1.list-manage.com/subscribe/post?u=5d8e8be1bc4711020b1d2223e&amp;id=f03eec1df0" method="post" id="mc-embedded-subscribe-form" name="mc-embedded-subscribe-form" class="validate" target="_blank" novalidate>
							    <div id="mc_embed_signup_scroll">
								<h2>Subscribe</h2>
							<div class="indicates-required"><span class="asterisk">*</span> indicates required</div>
							<div class="mc-field-group">
								<label for="mce-FNAME">Full Name  <span class="asterisk">*</span>
							</label>
								<input type="text" value="" name="FNAME" class="required" id="mce-FNAME" />
							</div>
							<div class="mc-field-group">
								<label for="mce-EMAIL">Email Address  <span class="asterisk">*</span>
							</label>
								<input type="email" value="" name="EMAIL" class="required email" id="mce-EMAIL" />
							</div>
							<div class="mc-field-group size1of2">
								<label for="mce-PHONE">Phone Number </label>
								<input type="text" name="PHONE" class="" value="" id="mce-PHONE" />
							</div>
							<div class="mc-field-group">
								<label for="mce-MMERGE2">Zip Code </label>
								<input type="text" value="" name="MMERGE2" class="" id="mce-MMERGE2" />
							</div>
								<div id="mce-responses" class="clear">
									<div class="response" id="mce-error-response" style={{display: none}}></div>
									<div class="response" id="mce-success-response" style={{display: none}}></div>
								</div>   
							    <div style="position: absolute; left: -5000px;" aria-hidden="true"><input type="text" name="b_5d8e8be1bc4711020b1d2223e_f03eec1df0" tabindex="-1" value="" /></div>
							    <div class="clear"><input type="submit" value="Subscribe" name="subscribe" id="mc-embedded-subscribe" class="button" /></div>
						    </div>
						</form>
					</div>
	        </div>
		);
	}
	render(){
		const url = 'https://friendsofbellingham.us1.list-manage.com/subscribe/post?u=5d8e8be1bc4711020b1d2223e&amp;id=f03eec1df0';
		return(
			<div className="volunteerHero fixedHeaderAdjust">
				<div className="primaryLightOverlay">
					<div className="gridCenter">
						<h1 className="white">volunteer</h1>
						<div>
							<MailchimpSubscribe
							    url={url}
							    render={this.renderInput}
							  />
						</div>
					</div>					
				</div>
			</div>
		);
	}
}

export default Volunteer;
